  return (
    <>
      <div className='success-stories-container d-flex-full d-flex-col'>
        <div className='success-stories-inner-container  d-flex-col gap-16 d-flex-jsc'>
          <p>
            Every step forward builds your legacyâ€”each small victory paving the
            way to a brighter future.
          </p>
          <div className='dasboard-btn-container '>
            <button className='p-16 cursor-ptr'>Education</button>
          </div>
          <div className='voice-assistent-gif-container d-flex-col d-flex-full cursor-ptr'>
            <img
              src={
                "https://mir-s3-cdn-cf.behance.net/project_modules/hd/f4020f114494633.603cbcc781296.gif"
              }
              style={{
                borderRadius: "100px",
                objectFit: "cover",
              }}
              alt=''
              width={70}
              height={70}
            />
            <span className='cursor-ptr'>Ask me </span>
          </div>
        </div>
      </div>
      <div className='success-stories-body-container'>
        <div className='succes-story-card d-flex-jsc'>
          <img
            src='https://www.bollywoodhungama.com/wp-content/uploads/2024/07/Sanjay-main.jpg'
            alt=''
          />
          <p>
            Sanjay Dutt, born into a film legacy, faced a tumultuous life marked
            by controversy and legal battles, including a stint in prison.
            Despite his early struggles and public setbacks, he made a
            remarkable comeback in Bollywood. His journey is a testament to
            resilience and the power of reinvention. Today, he stands as an
            inspiring figure who transformed his life against all odds.
          </p>
        </div>
      </div>
    </>
  );
};

export default SuccessStory;
